import './card-style.css'


class Card extends React.Component {
  render() {
    return (
    	<article className="flashcard">
		  <label for="toggle-1">Do Something</label>
		  <input type="checkbox" id="toggle-1" />
		  <div className="blah">Control me</div>
		  <p>LLALAL</p>
		</article>
    );
  }
}

export default Card;
